import React from 'react';
const Product = ({product}) => {
    return ( 

        <div class="card-deck">
        <div class="card">
          <img src={product.image} class="card-img-top" alt="..."/>
          <div class="card-body">
            <h5 class="card-title">{product.name}</h5>

          </div>
        </div>
 
      </div>

     );
}
 
export default Product;
